<span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">However, this </span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">is</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> more restrictive, so the Rasl transform </span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">is</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> introduced:</span></span>
